import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './index.css';
import App from './App';
import { AuthProvider } from './context/AuthContext';
import './services/axiosConfig'; // Import axios configuration

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <AuthProvider>
        <App />
        <ToastContainer 
          position="top-right"
          autoClose={5000}
          hideProgressBar={false}
          newestOnTop
          closeOnClick
          rtl={false}
          pauseOnFocusLoss
          draggable
          pauseOnHover
          theme="light"
          limit={3}
          toastClassName={(context) => {
            // Filter out blank/white popups, only show red error popups
            if (context?.type !== 'error') {
              return 'hidden';
            }
            // Also hide 'not found' error messages
            if (context?.defaultValue?.includes('not found')) {
              return 'hidden';
            }
            return 'Toastify__toast';
          }}
        />
      </AuthProvider>
    </BrowserRouter>
  </React.StrictMode>
);
